    float[,] y_list = new float[15, 512];

    //Rigidbody2Dを宣言する
    Rigidbody2D rigid2D;
    //プレイヤ２が動くスピード(毎フレーム)
    static public int speed_p2;

    //GameDirectorオブジェクトの宣言
    GameObject director;

    // Start is called before the first frame update
    void Start()
    {
        //時間切れかどうかの判定変数の初期化
        Finished2 = false;

        //rigidbody2Dの呼び出し
        this.rigid2D = GetComponent<Rigidbody2D>();

        //「GameDirector」スクリプトが持つメソッド（加算メソッド）を呼び出すため、監督オブジェクトをシーンビューからFindメソッドで検索
        this.director = GameObject.Find("GameDirector");
    }

    // Update is called once per frame
    void Update()
    {
    }

    //パターン
    public void FixedUpdate()
    {
        //制限時間外となれば、操作を中止
        if (Finished2 == false)
        {
            //player2の動きを0.2秒ごとの動きとする。
            //→動きが遅すぎる

            ////一定の時間間隔での処理実行
            ////1000ms(0.01s)毎
            //timeElapsed += Time.deltaTime;
            //if (timeElapsed < 0.01f) return;
            //timeElapsed = 0.0f;

            //player2の動きのアルゴリズム実行
            var x = x_list[GameSettingController.pattern_num, i];
            i++;
            if (i > 909)
            {
                //for debug
                Debug.Log("一周終わり");
                i = 0;
            }

            //yの生成
            var y = Random.Range(-0.5f, 0.5f);
            //player2の移動
            rigid2D.velocity = new Vector2(x, y) * speed_p2;
        }else {
            rigid2D.velocity = Vector2.zero;
            rigid2D.angularVelocity = 0f;
        }
    }

    //当たり判定
    //相手の弾に当たれば、スコアの更新と初期位置にテレポート
    private void OnCollisionEnter2D(Collision2D other)
    {
        if (other.collider.tag == "bullet")
        {
            //非表示
            gameObject.SetActive(false);
            //ポイントを更新
            this.director.GetComponent<GameDirector>().ScorePlus_b();
            //初期位置にテレポート
            gameObject.transform.position = new Vector3(4, 3, 0);
            //表示
            gameObject.SetActive(true);
        }
    }
